import React from 'react';
import Bestsellers from './Bestsellers';

function HomePage({ products, onAddToCart }) {
  const textStyle = {
    backgroundColor: 'rgba(255, 255, 255, 0.4)', // Vit färg med 0.4 opacitet
    padding: '5px 10px', // Lite utrymme runt texten
    borderRadius: '5px', // Rundade hörn
  };

  return (
    <div>
      <h1 style={{ textAlign: 'center' }}>
        <span style={textStyle}>Välkommen till vår webbshop!</span>
      </h1>
      <Bestsellers products={products} onAddToCart={onAddToCart} />
    </div>
  );
}

export default HomePage;
